import React, { useContext, useState } from "react";
import DataTable from "./DataTable";
import "./Places.css";
import Button from "@mui/material/Button";
import AddIcon from "@mui/icons-material/Add";
import TextField from "@mui/material/TextField";

import { Link } from "react-router-dom";

import { AuthContext } from "../../AuthContext";
import { AuthProvider } from "../../AuthContext";

const Places = () => {
  const { token, api } = useContext(AuthContext);
  const tokenValue = String(localStorage.getItem("jwtToken"));
  const [jwtToken, setJwtToken] = token;
  const [apiUrl, setApiUrl] = api;
  const [search, setSearch] = useState("");

  const buttonStyle = {
    backgroundColor: "#1ca395",
  };
  const searchStyle = {
    width: "350px",
  };
  setJwtToken(localStorage.getItem("jwtToken"));

  return (
    <AuthProvider>
      <div className="places-container">
        <h1 className="heading"> Pet Places </h1>
        <div className="places-actions">
          <TextField
            label="Search the places..."
            sx={searchStyle}
            onChange={(e) => setSearch(e.target.value)}
          />
          <Link to="/places/add-place" style={{ textDecoration: "none" }}>
            <Button
              sx={buttonStyle}
              variant="contained"
              startIcon={<AddIcon />}
            >
              Add Place
            </Button>
          </Link>
        </div>
        <DataTable token={jwtToken} apiUrl={apiUrl} search={search} />
      </div>
    </AuthProvider>
  );
};

export default Places;
